{
  "translationLines": [
    {
      "lineNumber": 139211,
      "originalJapaneseLine": "ハウゼルが顔を伏せる。",
      "translatedEnglishLine": "Howzer lowered his face."
    },
    {
      "lineNumber": 139212,
      "originalJapaneseLine": "その表情には色がなかった。",
      "translatedEnglishLine": "There was no color in his expression."
    },
    {
      "lineNumber": 139213,
      "originalJapaneseLine": "「残念ながら……」",
      "translatedEnglishLine": "\"Unfortunately...\""
    },
    {
      "lineNumber": 139214,
      "originalJapaneseLine": "「現在の戦力では救出は不可能……です」",
      "translatedEnglishLine": "\"With the current forces, a rescue is impossible...\""
    },
    {
      "lineNumber": 139215,
      "originalJapaneseLine": "「不可能？",
      "translatedEnglishLine": "\"Impossible?"
    },
    {
      "lineNumber": 139216,
      "originalJapaneseLine": "　ふん、そんな言葉は聞き飽きた」",
      "translatedEnglishLine": "Hmph, I'm tired of hearing such words.\""
    },
    {
      "lineNumber": 139217,
      "originalJapaneseLine": "「俺様はどんな戦いでも勝ち続けた。",
      "translatedEnglishLine": "\"I have continued to win every battle."
    },
    {
      "lineNumber": 139218,
      "originalJapaneseLine": "　だから今回もいつものように勝つだけだ」",
      "translatedEnglishLine": "So this time too, I will just win as always.\""
    },
    {
      "lineNumber": 139219,
      "originalJapaneseLine": "「ホーネットは先代魔王の娘、",
      "translatedEnglishLine": "\"Hornet is the daughter of the previous Demon King,"
    },
    {
      "lineNumber": 139220,
      "originalJapaneseLine": "　いわば魔物界のプリンセスだ」",
      "translatedEnglishLine": "In other words, a princess of the demon world.\""
    },
    {
      "lineNumber": 139221,
      "originalJapaneseLine": "「俺様は今まで全ての姫を手に入れた。",
      "translatedEnglishLine": "\"I have claimed every princess until now."
    },
    {
      "lineNumber": 139222,
      "originalJapaneseLine": "　ならば、当然ホーネットも手に入れる」",
      "translatedEnglishLine": "Therefore, naturally, I will also claim Hornet.\""
    },
    {
      "lineNumber": 139223,
      "originalJapaneseLine": "「なっ！",
      "translatedEnglishLine": "\"Wha-!"
    },
    {
      "lineNumber": 139224,
      "originalJapaneseLine": "　なんて不埒なことを貴様ーッ！」",
      "translatedEnglishLine": "How dare you say something so outrageous!\""
    },
    {
      "lineNumber": 139225,
      "originalJapaneseLine": "「ここで俺様がズババーンと格好良く助けたら、",
      "translatedEnglishLine": "\"If I swoop in here and heroically save her,"
    },
    {
      "lineNumber": 139226,
      "originalJapaneseLine": "　きっと俺に惚れるな。間違いない」",
      "translatedEnglishLine": "She'll definitely fall for me. No doubt.\""
    },
    {
      "lineNumber": 139227,
      "originalJapaneseLine": "「ぐふふ、そうなったら……」",
      "translatedEnglishLine": "\"Hehe, if that happens...\""
    },
    {
      "lineNumber": 139228,
      "originalJapaneseLine": "「お、お前、いい加減に……」",
      "translatedEnglishLine": "\"Y-you, enough already...\""
    },
    {
      "lineNumber": 139229,
      "originalJapaneseLine": "ランスとサテラが言い合っているのを見ながら、",
      "translatedEnglishLine": "Watching Rance and Satera argue,"
    },
    {
      "lineNumber": 139230,
      "originalJapaneseLine": "それまで黙っていた火炎書士が溜め息を吐いた。",
      "translatedEnglishLine": "The Fire Mage, who had been silent until then, sighed."
    },
    {
      "lineNumber": 139231,
      "originalJapaneseLine": "「す、すごい方ですね……",
      "translatedEnglishLine": "\"He is an amazing person..."
    },
    {
      "lineNumber": 139232,
      "originalJapaneseLine": "　ランスさん、本気でセックスの為に",
      "translatedEnglishLine": "Rance is seriously intending to rescue Hornet for sex..."
    },
    {
      "lineNumber": 139233,
      "originalJapaneseLine": "　ホーネット様救出する気ですよ……」",
      "translatedEnglishLine": "\"He's determined to rescue Lady Hornet...\""
    },
    {
      "lineNumber": 139234,
      "originalJapaneseLine": "「そうね……」",
      "translatedEnglishLine": "\"That's right...\""
    },
    {
      "lineNumber": 139235,
      "originalJapaneseLine": "「ふふ、いっそ信頼しやすいわね」",
      "translatedEnglishLine": "\"Hehe, that might make him somewhat trustworthy.\""
    },
    {
      "lineNumber": 139236,
      "originalJapaneseLine": "「いやいや、信頼しちゃ駄目ですよ。",
      "translatedEnglishLine": "\"No, no, you shouldn't trust him."
    },
    {
      "lineNumber": 139237,
      "originalJapaneseLine": "　あれは目的に沿わなければ簡単に人を",
      "translatedEnglishLine": "He can easily throw people away if they don't fit his goals."
    },
    {
      "lineNumber": 139238,
      "originalJapaneseLine": "　ポイできる人ですよ」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 139239,
      "originalJapaneseLine": "「そうかしら……」",
      "translatedEnglishLine": "\"Is that so...\""
    },
    {
      "lineNumber": 139240,
      "originalJapaneseLine": "「そうですよぅ……」",
      "translatedEnglishLine": "\"That's right...\""
    },
    {
      "lineNumber": 139241,
      "originalJapaneseLine": "「待っていたわ」",
      "translatedEnglishLine": "\"I've been waiting for you.\""
    },
    {
      "lineNumber": 139242,
      "originalJapaneseLine": "開口一番、魔人シルキィはそう言った。",
      "translatedEnglishLine": "As soon as she spoke, the demon girl Silky said so."
    },
    {
      "lineNumber": 139243,
      "originalJapaneseLine": "「私のところに来たということは……」",
      "translatedEnglishLine": "\"The fact that you came to me means...\""
    },
    {
      "lineNumber": 139244,
      "originalJapaneseLine": "「うむ、そろそろホーネットを助けに行く。",
      "translatedEnglishLine": "\"Yes, it's about time to go rescue Hornet."
    },
    {
      "lineNumber": 139245,
      "originalJapaneseLine": "　もちろん、君にも協力してもらうぞ」",
      "translatedEnglishLine": "Of course, we'll need your help too.\""
    },
    {
      "lineNumber": 139246,
      "originalJapaneseLine": "シルキィは戦場に立っているときの",
      "translatedEnglishLine": "Silky responded not in her warrior tone on the battlefield,"
    },
    {
      "lineNumber": 139247,
      "originalJapaneseLine": "武人のような口調ではなく、",
      "translatedEnglishLine": "but with the voice of a girl."
    },
    {
      "lineNumber": 139248,
      "originalJapaneseLine": "女の子の口調で答えた。",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 139249,
      "originalJapaneseLine": "「ええ、分かったわ。",
      "translatedEnglishLine": "\"Yes, I understand."
    },
    {
      "lineNumber": 139250,
      "originalJapaneseLine": "　必要なときにはいつでも呼んで。",
      "translatedEnglishLine": "Call on me anytime you need."
    },
    {
      "lineNumber": 139251,
      "originalJapaneseLine": "　準備なら出来てる」",
      "translatedEnglishLine": "I'm ready.\""
    },
    {
      "lineNumber": 139252,
      "originalJapaneseLine": "「ところで……",
      "translatedEnglishLine": "\"By the way..."
    },
    {
      "lineNumber": 139253,
      "originalJapaneseLine": "　なにをしていたんだ？」",
      "translatedEnglishLine": "What were you doing?\""
    },
    {
      "lineNumber": 139254,
      "originalJapaneseLine": "シルキィは重量200キロある魔導具リトルを",
      "translatedEnglishLine": "Silky was lifting the magical tool 'Little', which weighs 200 kilograms,"
    },
    {
      "lineNumber": 139255,
      "originalJapaneseLine": "バーベル代わりにして片手で持ち上げていた。",
      "translatedEnglishLine": "using it as a barbell, lifting it with one hand."
    },
    {
      "lineNumber": 139256,
      "originalJapaneseLine": "「軽いトレーニングね。",
      "translatedEnglishLine": "\"Just a light workout."
    },
    {
      "lineNumber": 139257,
      "originalJapaneseLine": "　貴方達もやる？」",
      "translatedEnglishLine": "Do you guys want to try?\""
    },
    {
      "lineNumber": 139258,
      "originalJapaneseLine": "「……いや、いい」",
      "translatedEnglishLine": "\"...No, thanks.\""
    },
    {
      "lineNumber": 139259,
      "originalJapaneseLine": "「しかし今まで戦い続けていたんだろ？",
      "translatedEnglishLine": "\"But you’ve been fighting nonstop until now, right?"
    },
    {
      "lineNumber": 139260,
      "originalJapaneseLine": "　ダラダラと過ごしたらどうだ？」",
      "translatedEnglishLine": "Why not take it easy for a while?\""
    }
  ]
}

